import React from 'react'
import Styles from './Footer.module.css'

export const Footer = () => {
    return (
        <footer className={Styles.footer}>
            <p>Created by <a href="https://github.com/Aditop" target="_blank"> Adilet Abduvaliev </a></p>
        </footer>
    )
}
